func parseFiles(t *Template, readFile func(string) (string, []byte, error), filenames ...string) (*Template, error) {
	if len(filenames) == 0 {
		// Not really a problem, but be consistent.
		return nil, fmt.Errorf("template: no files named in call to ParseFiles")
	}
	for _, filename := range filenames {
		name, b, err := readFile(filename)
		if err != nil {
			return nil, err
		}
		s := string(b)
		// First template becomes return value if not already defined,
		// and we use that one for subsequent New calls to associate
		// all the templates together. Also, if this file has the same name
		// as t, this file becomes the contents of t, so
		//  t, err := New(name).Funcs(xxx).ParseFiles(name)
		// works. Otherwise we create a new template associated with t.
		var tmpl *Template
		if t == nil {
			t = New(name)
		}
		if name == t.Name() {
			tmpl = t
		} else {
			tmpl = t.New(name)
		}
		_, err = tmpl.Parse(s)
		if err != nil {
			return nil, err
		}
	}
	return t, nil

fn insert_permission(&mut self, identifier: String) {
  match self {
    TomlOrJson::Toml(t) => {
      let permissions = t.entry("permissions").or_insert_with(|| {
        toml_edit::Item::Value(toml_edit::Value::Array(toml_edit::Array::new()))
      });
      if let Some(permissions) = permissions.as_array_mut() {
        permissions.push(identifier)
      };
    }

    TomlOrJson::Json(j) => {
      if let Some(o) = j.as_object_mut() {
        let permissions = o
          .entry("permissions")
          .or_insert_with(|| serde_json::Value::Array(Vec::new()));
        if let Some(permissions) = permissions.as_array_mut() {
          permissions.push(serde_json::Value::String(identifier))
        };
      }
    }
  };

