        EncoderCfg::VPX(_) => Ok(Encoder {
            codec: Box::new(VpxEncoder::new(config, i444)?),
        }),
        EncoderCfg::AOM(_) => Ok(Encoder {
            codec: Box::new(AomEncoder::new(config, i444)?),
