func (gn *GroupNormLayer) Forward(x *mlx.Array) *mlx.Array {
	// x: [B, H, W, C] (NHWC format)
	shape := x.Shape()
	B := shape[0]
	H := shape[1]
	W := shape[2]
	C := shape[3]

	// For large spatial sizes, use tiled computation to avoid CUDA grid limits
	// CUDA grid.y max is 65535, so H*W/16 must be <= 65535, meaning H*W <= ~1M
	// To be safe, tile when H*W > 512*512 = 262144
	if H*W > 512*512 {
		return gn.forwardTiled(x, B, H, W, C)
	}

	return gn.forwardSmall(x, B, H, W, C)

pub fn merge_plist(src: Vec<PlistKind>) -> crate::Result<plist::Value> {
  let mut merged_plist = plist::Dictionary::new();

  for plist_kind in src {
    let src_plist = match plist_kind {
      PlistKind::Path(p) => plist::Value::from_file(&p)
        .with_context(|| format!("failed to parse plist from {}", p.display()))?,
      PlistKind::Plist(v) => v,
    };
    if let Some(dict) = src_plist.into_dictionary() {
      for (key, value) in dict {
        merged_plist.insert(key, value);
      }
    }
  }

  Ok(plist::Value::Dictionary(merged_plist))

